    width: '100%',
    height: '100%',
    display: 'flex',
    justifyContent: 'center',
    // border:"1px solid black" ,
    margin: '40px auto',
    // marginBottom : '200px'
})

const Item = styled(Box)({})


function Home() {


    const [items, setItems] = useState([]);

    useEffect(() => {
        loginStatus = loginStatus;

        const getAllItems = async () => {
            const data = await getItems();
            setItems(data);
        }
        getAllItems();
